import React from 'react';
import logo from '../img/logo.png';
import classes from '../Header/Header.module.css'
const Header = () => {
    return (
        <div className={classes}>
            <img src={logo} className={classes}>
            </img>
            <nav>
                <div className={classes}>
                </div>
            </nav>
        </div>
    );
};

export default Header;
